def increasing(prev, arr):
    m = []
    for i in range(len(arr)):
        if arr[i] > prev:
            new_arr = arr[i+1:]
            j = 0
            while j < len(new_arr):
                if new_arr[j] <= arr[i]:
                    new_arr = new_arr[:j] + new_arr[j+1:]
                else:
                    j += 1
            a = increasing(arr[i], new_arr)
            if len(a) > len(m):
                m = a

    return [prev] + m


def decreasing(prev, arr):
    m = []
    for i in range(len(arr)):
        if arr[i] < prev:
            new_arr = arr[i+1:]
            j = 0
            while j < len(new_arr):
                if new_arr[j] >= arr[i]:
                    new_arr = new_arr[:j] + new_arr[j+1:]
                else:
                    j += 1
            a = decreasing(arr[i], new_arr)
            if len(a) > len(m):
                m = a

    return [prev] + m


